      <label>Stato</label>
      <div className="toggleAperte">
        <button>Aperte</button>
        <button>Chiuse</button>
      </div>
      <label>Multa</label>
      <input type="text" value="123€" readOnly />
      <input type="text" placeholder="...€" />
      <label>Data e ora</label>
      <input type="date" />
      <input type="date" />
    </div>
  </div>;
};

export default FiltroForm;
